Default:
if (<WESTERNDIGITAL_Supplier_DataExchange> = "n") then "n"
else If(
   (Intersects(("financial"), (<WESTERNDIGITAL_Data_Class_List>)) and Intersects(("cc", "cardholder"), (<WESTERNDIGITAL_Data_Class_List_Financial_List>))) 
 or (Intersects(("employment"), (<WESTERNDIGITAL_Data_Class_List>)) and Intersects(("cc"), (<WESTERNDIGITAL_Data_Class_List_Employment_List>))) 
)Then "PCI" 
Else If (<Supplier_Is_Legacy> <> "y" and <WESTERNDIGITAL_Supplier_Expedite> <> "y") Then "n"

Calculation:
If (<WESTERNDIGITAL_FINAL_Annual> in ("$100,001 to $250K","$250,001 to $500K")) Then Decode(<WESTERNDIGITAL_Overview_Commodity_Manager>,"WESTERNDIGITAL.Overview.Commodity.Manager","director")
else if (<WESTERNDIGITAL_FINAL_Annual> = "$500,001 to $1M") Then Decode(<WESTERNDIGITAL_Overview_Commodity_Manager>,"WESTERNDIGITAL.Overview.Commodity.Manager","senior_director")
else if (<WESTERNDIGITAL_FINAL_Annual> = "$1,000,001 to $5M") Then Decode(<WESTERNDIGITAL_Overview_Commodity_Manager>,"WESTERNDIGITAL.Overview.Commodity.Manager","vice_president")
else if (<WESTERNDIGITAL_FINAL_Annual> = ">$5M") Then Decode(<WESTERNDIGITAL_Overview_Commodity_Manager>,"WESTERNDIGITAL.Overview.Commodity.Manager","cpo")
Else HasRole("Admin")
